import React from "react";
class Message extends React.Component{
    constructor(){
        super();
        this.state={
            name:"naveen",
            city:"tadipatri",
            role:"full stack python"
        }
    }
    handleHari=()=>{
        this.setState({
            name:"hari",
            city:"Turipati",
            role:"recat"
        })
    }
    render(){
        return(
            <div>
            {this.state.name}<br/>
            {this.state.city}<br/>
            {this.state.role}<br/>


            <button onClick={this.state.handleHari}>ADD</button>

            </div>
        )
    }
}
export default Message;
